--
-- Table structure for table `user`
--

DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '服务用户主键',
  `app_id` char(18) NOT NULL COMMENT '调用者账号',
  `app_secret` char(32) NOT NULL COMMENT '调用者密码',
  `role` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '角色',
  `app` tinyint(3) DEFAULT NULL COMMENT '对内对应的项目',
  `remark` varchar(128) DEFAULT NULL COMMENT '调用者备注信息',
  `add_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录更新时间',
  `state` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '记录状态：1 正常，0 逻辑删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='服务用户表';
/*!40101 SET character_set_client = @saved_cs_client */;

